import {
  faChampagneGlasses,
  faSquare,
  faBurger,
  faGlassWater,
  faArrowDownLong,
  faArrowUpLong,
  faBriefcase,
  faCommentDollar,
  faSackDollar,
  faCar,
  faBold,
  faBoltLightning,
} from "@fortawesome/free-solid-svg-icons";
import { itemList } from "../itemsDB/items";
import ItemIcon from "./Items/ItemIcon";
import ItemInfo from "./Items/ItemInfo";
import ItemCost from "./Items/ItemCost";
import ItemContainer from "./Items/wrappers/ItemContainer";
import Wrapper from "./Items/wrappers/Wrapper";
import { useState } from "react";

function Expenses(props) {
  const [expenses, setNewExpenses] = useState(itemList);

  let expense = {};

  const getIcons = (category) => {
    switch (category) {
      case "incoming":
        return [faSquare, faBriefcase];
      case "transfer":
        return [faSquare, faSackDollar];
      case "car":
        return [faSquare, faCar];
      case "bizum":
        return [faSquare, faCommentDollar];
      case "bill":
        return [faSquare, faChampagneGlasses];
      case "electricity":
        return [faSquare, faBoltLightning];
      default:
        break;
    }
  };

  expense = {};

  return (
    <Wrapper
      content={itemsList.map((item, index) => {
        return (
          <ItemContainer key={index}>
            <ItemIcon icons={item.icons} classes={item.classes} />
            <ItemInfo data={item.data} />
            <ItemCost money={item.money} />
          </ItemContainer>
        );
      })}
    />
  );
}

export default Expenses;
